import React from 'react';
import JavascriptLogo from "./mainImages/JSLogo.png";
import ReactLogo from "./mainImages/ReactLogo.png";
import NodeLogo from "./mainImages/NodeLogo.png";
import HTMLLogo from "./mainImages/HTMLLogo.jpg";
import CSSLogo from "./mainImages/CSSLogo.png";
import GitLogo from "./mainImages/GitLogo.png";

export default function Skills() {
    return (
      <div className="Skills-Container">
          <img
            className="JavaScript"
            src={JavascriptLogo}
          />
          <img
            className="React"
            src={ReactLogo}
          />
          <img
            className="Node"
            src={NodeLogo}
          />
          <img
            className="HTML"
            src={HTMLLogo}
            alt="Tokyo Cityscape Background"
          />
          <img
            className="CSS"
            src={CSSLogo}
            alt="Tokyo Cityscape Background"
          />
          <img
            className="Git"
            src={GitLogo}
            alt="Tokyo Cityscape Background"
          />
      </div>
    );
  }
